window.bookSummaryJSON = "<p>They may have recently averted a full-scale galactic war, but Cal Carver and Space Team just can't stay out of trouble.</p> <p>When a Weird Space Thingâ„¢ threatens to destroy planet Earth, Cal is determined to stop it. But when they get there, they find the place is still swarming with parasitic extra-terrestrial bugs, and that there isn't a whole lot left to save.</p> <p>While battling an unexpected ghost of the past, Cal is abducted by aliens. Again. Brought before their covert High Council, Cal is given a choice: save his Earth and doom countless others to oblivion, or sacrifice it, so that parallel Earths may live. Cal opts for none of the above, but his proposed solution might well doom not just his universe, but <i>all</i> universes everywhere.</p> <p><b>Featuring familiar strangers, unfamiliar friends, and an angry talking sheep named Duggie, </b><b><i>Return of the Dead Guy</i></b><b> is the reality-shattering sixth book in the Space Team saga.</b></p>"; 
